import {
  MDBBtn,
  MDBCard,
  MDBCardBody,
  MDBCardImage,
  MDBCardTitle,
  MDBCol,
  MDBCardText,
  MDBInput,
  MDBIcon,
} from "mdbreact";
import { useEffect, useState } from "react";

function Signup (){

    const[email,setemail]=useState("");
    const[password,setpassword]=useState("");
    
    useEffect(()=>{
        window.addEventListener("email",emaillistener);
        window.addEventListener("password",passwordlistener);
        window.addEventListener("submit",submitlistener)
        return()=>window.removeEventListener("email",emaillistener);
    });

    function emaillistener(event){
        setemail(event.target.value);
    }

    function passwordlistener(event){
        setpassword(event.target.value);
    }

    function submitlistener(){
        console.log(email+" "+password);
    }

    return (
      <div
        style={{ height: "100vh", verticalAlign: "middle" }}
        class="col text-center align-self-center"
      >
        <br />
        <br />
        <br />
        <br />
        <br />
        <br />

        <MDBCol className="row justify-content-center align-self-center">
          <MDBCard
            color="stylish-color"
            style={{ width: "31rem", color: "white" }}
            class="col-xs-1"
          >
            <MDBCardBody>
              <MDBCardTitle>
                <MDBIcon icon="user-plus" />
                &nbsp; Sign Up
              </MDBCardTitle>
              <MDBCardText
                style={{
                  color: "white",
                  alignItems: "center",
                  justifyContent: "center",
                  textAlign: "center",
                }}
              >
                <div
                  className="form-group"
                  style={{
                    alignItems: "center",
                    justifyContent: "center",
                    textAlign: "center",
                  }}
                >
                  <div
                    style={{
                      textAlign: "center",
                      alignContent: "center",
                      justifyContent: "center",
                    }}
                  >
                    <label>
                      <MDBIcon icon="user" /> &nbsp; Email
                    </label>
                    <br />

                    <input
                      type="text"
                      id="Email"
                      className="form-control form-control-md"
                      email
                      required
                      style={{ width: "450px", textAlign: "center" }}
                      onChange={emaillistener}
                    />
                  </div>
                  <br />
                  <label>
                    <MDBIcon icon="key" /> &nbsp; Password
                  </label>
                  <input
                    type="password"
                    id="Password"
                    className="form-control form-control-md"
                    style={{ width: "450px", textAlign: "center" }}
                    onChange={passwordlistener}
                    required
                  />
                </div>
              </MDBCardText>
              <MDBBtn
                color="danger"
                href="#"
                style={{ width: "150px" }}
                onClick={submitlistener}
              >
                Back
              </MDBBtn>
              &nbsp; &nbsp; &nbsp; &nbsp;
              <MDBBtn
                color="success"
                href="#"
                style={{ width: "250px" }}
                onClick={submitlistener}
              >
                + Create new Account
              </MDBBtn>
            </MDBCardBody>
          </MDBCard>
        </MDBCol>
      </div>
    );
}

export default Signup;
